import React from 'react';

import theme from '../UI/Theme';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';


const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none",
  [theme.breakpoints.down("md")]: {
    width: "100%",
  }
})

const OutlinedButton = styled(Button)({
  ...theme.typography.buttonCustomization
})

const TopBanner = () => {
  return (
<React.Fragment>
  <div>
    <h1>We help you find the best solution </h1>
    <p>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum. At nam minimum ponderum. Est audiam animal molestiae te. Ex duo eripuit mentitum.</p>
    <ContainedButton variant="contained" color="secondary">Contact Now</ContainedButton>
    <OutlinedButton variant="outlined" color="secondary">Learn More</OutlinedButton>
  </div>
</React.Fragment>
  )
};

export default TopBanner;
